description:
The &quot;The Beatles Second Album&quot; Compact 33 EP was released by Capitol Records in January 1964 for use in juke boxes only. 

Track Listing [320k MP3]

    1. &quot;Thank You Girl&quot; 
    2. &quot;Devil In Her Heart&quot;
    3. &quot;Money&quot;
    4. &quot;Long Tall Sally&quot;
    5. &quot;I Call Your Name&quot;
    6. &quot;Please Mr. Postman&quot;
